	/** Calculate Average Sell Price when selling off a certain volume - returns average and lowest price */ 
	public double[] estimateAvgSellPriceV(double pvolume){
		
		int i=0;
		double svolume=0.0d;
		double samount=0.0d;
		double curprice=0.0d;
		
		if ((pvolume<=0.0d)&&(bids.size()>0))
			return new double[]{0.0d,bids.get(i)[OrderBook.PRICE]};
		if ((pvolume<=0.0d)&&(bids.size()==0))
			return new double[]{0.0d,0.0d};
		
		while ((svolume<pvolume)&&(i<bids.size())){
			double delta=pvolume-svolume;
			curprice=bids.get(i)[OrderBook.PRICE];
			double curvol=bids.get(i)[OrderBook.VOL];
			
//			System.out.println(String.format(Locale.US,"%.8f",curvol)+" "+String.format(Locale.US,"%.8f",curprice));
			
			
			if (curvol<=delta){
				svolume+=curvol;
				samount+=curvol*curprice;
			} else { 
				svolume+=delta;
				samount+=delta*curprice;
			}
			i++;
		}
		// market sell-out ; assume lastsell == 0.0d when not enough bids available
		if (svolume<pvolume)
			curprice=0.0d;
				
		return new double[]{samount/pvolume,curprice};
	}

	/** Calculate Average Sell Price to obtain a certain amount - returns average and lowest price */ 
	public double[] estimateAvgSellPriceA(double pamount){
		
		int i=0;
		double svolume=0.0d;
		double samount=0.0d;
		double curprice=0.0d;
		
		if ((pamount<=0.0d)&&(bids.size()>0))
			return new double[]{0.0d,bids.get(i)[OrderBook.PRICE]};
		if ((pamount<=0.0d)&&(bids.size()==0))
			return new double[]{0.0d,0.0d};
		
		while ((samount<pamount)&&(i<bids.size())){
			double delta=pamount-samount;
			curprice=bids.get(i)[OrderBook.PRICE];
			double curvol=bids.get(i)[OrderBook.VOL];
			
			if ((curprice*curvol)<=delta){
				svolume+=curvol;
				samount+=curvol*curprice;
			} else { 
				svolume+=delta/curprice;
				samount+=delta;
			}
			i++;
		}
		// market sell-out ; when not enough bids available, return negative endprice to indicate shortage
		if (samount<pamount)
			curprice=-1.0d;
				
		return new double[]{samount/svolume,curprice};
	}
	
	/** Calculate Average Buy Price when buying a certain volume - returns average and highest price */ 
	public double[] estimateAvgBuyPriceV(double pvolume){
		
		int i=0;
		double svolume=0.0d;
		double samount=0.0d;
		double curprice=0.0d;
		
		if ((pvolume<=0.0d)&&(asks.size()>0))
			return new double[]{0.0d,asks.get(i)[OrderBook.PRICE]};
		if ((pvolume<=0.0d)&&(asks.size()==0))
			return new double[]{0.0d,0.0d};
		
		while ((svolume<pvolume)&&(i<asks.size())){
			double delta=pvolume-svolume;
			curprice=asks.get(i)[OrderBook.PRICE];
			double curvol=asks.get(i)[OrderBook.VOL];
			
			if (curvol<=delta){
				svolume+=curvol;
				samount+=curvol*curprice;
			} else { 
				svolume+=delta;
				samount+=delta*curprice;
			}
			i++;
		}
		// market buy-out ; assume lastbuy == infinity when not enough asks available
		if (svolume<pvolume){
			return new double[]{Double.MAX_VALUE,Double.MAX_VALUE};
		}
				
		return new double[]{samount/pvolume,curprice};
	}
	
